You can use Firebase's anonymous authentication feature to authenticate guest users. Here's how you can do it:

1. First, you need to enable anonymous authentication in your Firebase console. Go to the Authentication section in your Firebase console, then click on the Sign-in method tab. Scroll down to the Anonymous section and enable it.

2. Next, you need to use the Firebase SDK to sign in anonymously. Here's an example of how you can do it in Laravel:

```php
use Kreait\Firebase\Factory;
use Kreait\Firebase\ServiceAccount;

$serviceAccount = ServiceAccount::fromJsonFile(__DIR__.'/path/to/your/firebase/credentials.json');

$firebase = (new Factory)
    ->withServiceAccount($serviceAccount)
    ->create();

$auth = $firebase->getAuth();

$anonymous = $auth->signInAnonymously();
```

3. After signing in anonymously, you can get the user's ID token and use it to authenticate requests to your Laravel application. Here's an example:

```php
$idToken = $anonymous->idToken();

// Use the ID token to authenticate requests to your Laravel application
```

4. You can also upgrade the anonymous user to a permanent account by linking the anonymous account to a new account created with a different sign-in method. Here's an example:

```php
$email = 'user@example.com';
$password = 'secretPassword';

$userRecord = $auth->createUserWithEmailAndPassword($email, $password);

$auth->updateUser($anonymous->uid, [
    'email' => $email,
]);

$auth->linkAndRetrieveDataWithCredential($anonymous->uid, $userRecord->user->createCustomToken());
```

